import logo from "./logo.svg";
import "./App.css";
import Navbar from "./components/layout/Navbar";
import { makeStyles } from "@material-ui/core/styles";
const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));
function App() {
  return <Navbar />;
}

export default App;
